import React, { Component } from "react";
import {
  MDBContainer,
  MDBRow,
  MDBCol,
  MDBInput,
  MDBBtn,
  MDBIcon,
  MDBCard,
  MDBCardBody,
  MDBModal,
  MDBModalBody,
  MDBModalFooter,
  MDBStreak
} from "mdbreact";

import TopNav from "./TopNavigationBar";
import SectionContainer from "./sectionContainer";
import CategoryCard from "./productCards/CategoryCard";

const Home = props => {
  console.log("PROPS: ", props);
  return (
    <div>
      <TopNav />
      <MDBContainer style={{ height: "2000px" }}>
        <MDBStreak
          size="md"
          by="Steve Jobs"
          overlayClass="white-text rgba-black-light pattern-1"
          photo="https://mdbootstrap.com/img/Photos/Horizontal/Nature/12-col/img(115).jpg"
        ></MDBStreak>
        <MDBRow>
          <MDBCol md="4">
            <CategoryCard />
          </MDBCol>
          <MDBCol md="4">
            <CategoryCard />
          </MDBCol>
          <MDBCol md="4">
            <CategoryCard />
          </MDBCol>
        </MDBRow>
      </MDBContainer>
    </div>
  );
};
export default Home;
